import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Button from 'react-bootstrap/Button';


function App() {
  return (
    <div className="App">
      <h1>Hello!</h1>
      <p>My first react app is working</p>
      <Button variant="primary">Click Me</Button>
    </div>
  );
}

export default App;
